<?php
/**
 * [将Base64图片转换为本地图片并保存]
 * @param  [Base64] $base64_image_content [要保存的Base64,不带data:image/xxx;base64,]
 * @param  [目录] $path [要保存的路径]
 */
function entrance_guard_base64_to_image($base64_image_content,$path){
    // 这一行是因为约定了门禁卡传过来都是jpeg格式，所以手动加上
    $base64_image = "data:image/jpeg;base64," . $base64_image_content;
    // 匹配出图片的格式
    if (preg_match('/^(data:\s*image\/(\w+);base64,)/', $base64_image, $result)){
        $type = $result[2];
        $new_file = $path."/".date('Ymd',time())."/";
        if(!file_exists($new_file)){
            //检查是否有该文件夹，如果没有就创建，并给予最高权限
            mkdir($new_file, 0700);
        }
        $new_file = $new_file.time().".{$type}";
        echo "[save] to " . $new_file . "\n\n";
        if (file_put_contents($new_file, base64_decode(str_replace($result[1], '', $base64_image)))){
            return '/'.$new_file;
        }else{
            return false;
        }
    }else{
        return false;
    }
};

$base64_image_content = "";

// 运行前记得改路径
$path = "/opt/entrance_guard";

entrance_guard_base64_to_image($base64_image_content,$path);

